/* eslint-disable no-unused-vars */
import {
  Tooltip
} from "@mui/material";

const Marker = (props) => {
  const {
    id,
    chartId,
    name,
    description,
    renders,
    antiproject,
    design,
    designer,
    source,
    estimatedCost,
    lastDate,
    costM,
    cords,
    onClick,
    color,
  } = props;
  return ( <
    Tooltip title = {
      name
    }
    placement = "top" >
    <
    g >
    <
    circle onMouseOver = {
      (evt) => evt.target.setAttribute('r', '15')
    }
    onMouseOut = {
      (evt) => evt.target.setAttribute('r', '10')
    }
    cx = {
      cords.x
    }
    cy = {
      cords.y
    }
    r = {
      9
    }
    fill = {
      color
    }
    stroke = "black"
    strokeWidth = {
      1
    }
    onClick = {
      () => onClick(props)
    }
    /> <
    text x = {
      cords.x - 2.7
    }
    y = {
      cords.y + 3.5
    }
    fill = "white"
    style = {
      {
        fontSize: "9px"
      }
    } >
    {
      chartId
    } <
    /text> <
    /g>  <
    /Tooltip>
  );
};

export default Marker;
